export default (function(a,b,c,d,e,f,g,h,i,j,k,l){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},bWIZnreaar:{data:{id:2052,attributes:{imdbId:"tt0438315",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTYxMDkyMTIwN15BMl5BanBnXkFtZTcwNjQ3MTkzMQ@@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"7.3\u002F10"},{Source:"Rotten Tomatoes",Value:"25%"},{Source:"Metacritic",Value:"40\u002F100"}],item_lang:{data:{id:2715,attributes:{title:"Peaceful Warrior",plot:"Dan Millman has it all: good grades, a shot at the Olympic team on the rings and girls lining up for the handsome Berkely college athlete all teams mates look up to with envy. Only one man shakes his confidence, an anonymous night gas station attendant, who like Socrates, keeps questioning every assumption in his life. Then a traffic crash shatters Dan's legs, and his bright future. Now Socrates's life coaching is to make or break Dan's revised ambition.",slug:"peaceful-warrior"}}},books:{data:[{id:10209,attributes:{title:c,description:h,thumbnail:i,authors:[a],firstBook:true,published:j,publisher:e,subtitle:k}},{id:10210,attributes:{title:"Wisdom of the Peaceful Warrior",description:"The best-selling author of Way of the Peaceful Warrior provides an incisive explanation of the novel's underlying philosophy and message, focusing on more than one hundred of the book's most enigmatic passages and discussing the key ideas behind them. Original. 50,000 first printing.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=wY601VuaYoQC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"2007-01-01",publisher:e,subtitle:"A Companion to the Book that Changes Lives"}},{id:10211,attributes:{title:c,description:h,thumbnail:i,authors:[a],firstBook:d,published:j,publisher:e,subtitle:k}},{id:10212,attributes:{title:c,description:"20th Anniversary Edition with New Afterword and Revisions by the Author Way of the Peaceful Warrior has become one of the most beloved spiritual sagas of our time. Shared among friends and families, this million-copy word-of-mouth bestseller has inspired men and women of all ages in twenty languages worldwide. Despite all his success, college student and world-champion athlete Dan Millman is haunted by a feeling that something is missing from his life. Awakened one night by dark dreams, he wanders into an all-night gas station, meets an old man named Socrates, and his world is changed forever. Guided by this eccentric old warrior, drawn to an elusive young woman named Joy, Dan begins a spiritual odyssey into realms of light and shadow, romance and mystery, toward a final confrontation that will deliver or destroy him. This classic tale, a blend of autobiographical fact and narrative fiction, told with heart and humor, speaks to the peaceful warrior in each of us. Countless readers have been moved to laughter and tears-even moments of illumination-as they rediscover life's larger meaning and purpose. Journey with Dan on the peaceful warrior's path to unreasonable happiness. Find out for yourself why this book changes lives.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=FUIHmRHf8SUC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Millman Dan"],firstBook:d,published:"2015-01-29",publisher:a,subtitle:l}},{id:10213,attributes:{title:c,description:"More and more people are ''waking up'' spiritually. And for most of them, the question becomes: now what? ''Information about life after awakening is usually not made public,'' explains Adyashanti. ''It's most often shared only between teachers and their students.'' The End of Your World is his response to a growing need for direction on the spiritual path. Consider the book you hold in your hands Adyashanti's personal welcome to ''a new world, a state of oneness.''",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=WJPj5uovfbwC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"2009-04-01",publisher:"ReadHowYouWant.com",subtitle:l}}]}}},meta:{}}},prerenderedAt:1681703514694}}("Dan Millman","movie","Way of the Peaceful Warrior",null,"H J Kramer","series",1,"Presents the author's personal account of his spiritual quest to unite the diverse realms of body, mind, and spirit by combining Eastern philosophy with Western fitness routines to become an example of the peaceful warrior.Now a major motion picture from Lionsgate starring Nick Nolte.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=NEU-1RfOMEwC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2006-01-01","A Book that Changes Lives","A Book That Changes Lives"))